import React from 'react';
import './Post.css';

export default function Post(props) {
  return (
    <div className='post' style={{justifyContent:'center'}}>     
        <h1>{props.name}</h1><br />
        <p>{props.price}</p><br />
        <button style={{width:'50px',height:'50px'}}>X</button>
    </div>
  );
}
